# OEIS sequence: A321443

def A321443(n):
    if n == 0:
        return 1
    c = 0
    for i in range(n):
        mi = i*(i+1) + n
        for j in range(i+1,n+1):
            k = mi - j*j
            if k < 0:
                break
            if not k % j:
                c += 1
    return c # _Chai Wah Wu_, Nov 10 2018

